import { cn } from "@/lib/utils";

interface ItemWithLinkProps {
  outerClassName?: React.HTMLAttributes<HTMLDivElement>["className"];
  innerClassName?: React.HTMLAttributes<HTMLOrSVGElement>["className"];
  forwardTo: string;
  svgPath: React.ReactNode;
  svgStyle?: React.CSSProperties;
  viewBox: string;
}

export function ItemWithLink({
  outerClassName,
  innerClassName,
  forwardTo,
  svgPath,
  svgStyle,
  viewBox,
}: ItemWithLinkProps) {
  return (
    <div
      className={cn(
        "transition-all duration-100 hover:brightness-125",
        outerClassName
      )}
    >
      <a href={forwardTo} target="_blank" rel="noopener noreferrer">
        <svg
          className={innerClassName}
          viewBox={viewBox}
          fill="currentColor"
          style={svgStyle}
        >
          {svgPath}
        </svg>
      </a>
    </div>
  );
}

